INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (1, 0, 102711, 16614068, 1, "誕生、日……？\n私のですか？\nなぜそんなことを\n覚えているのですか？", 11, 16614, 10, 0.5, 0);
