INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (1, 0, 103011, 27814083, 1, "そうデス！\nクウカのために、\nショーグンも手伝ってくれたデスよ！\nみんなで甘いケーキを食べまショウ！", 11, 27814, 10, 0.5, 0);
