INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (1, 0, 100611, 34314076, 1, "もちろん、甘々で、プルプルのプリンを\nたくさん用意してきたよ～♪\n一度に頬張ったら、お口から\n垂れてきちゃうかも～♪", 11, 34314, 10, 0.5, 0);
