INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (1, 0, 103711, 35814070, 1, "いや、今までさんざん私たちの\n誕生日に顔出してたじゃないですか。\n毎度ノリノリで準備してたし、\nもうとっくに開き直ってるのかと。", 11, 35814, 10, 0.5, 0);
